import OrderStatusCard from '../../components/OrderStatusCard';
import './SellerOrderStatus.css';

function SellerOrderStatus() {
    return (
        <div className="" style={{backgroundColor: "red"}}>
            <h3 className="sellerPageTitle">Order Status</h3>
            <span className="LineSeperator mb-5" />
            <div className="noScroll" style={{height: 600}}>
            <OrderStatusCard />
            <OrderStatusCard />
            <OrderStatusCard />
            <OrderStatusCard />
            <OrderStatusCard />
            </div>
        </div>
    )
}

export default SellerOrderStatus
